<?php

// Authorize
function tin_authorize(){
	require_once(THEME_DIR."/tin-config.php");
	$code = '';
	//if(in_array($_SERVER['SERVER_NAME'],array('127.0.0.1','localhost'))) return;
	$tinVersion = wp_get_theme()->get( 'Version' );
	$post = 1;
	$active = 0;
	$key = '';
	$server = strtolower($_SERVER['SERVER_NAME']);
	$server_arr = explode('.', $server);
	if(count($server_arr)==3){$server = $server_arr[1].'.'.$server_arr[2];}
	if(get_option('_wp_tin_authorize2')){
		$info = get_option('_wp_tin_authorize2');
		$info_arr = json_decode($info);
		if(($info_arr->active==1)&&($info_arr->time+3600*24*7>time())){
			$post = 0;
			$active = 1;
			$key = $info_arr->key;
		}
	}
	if($post==1){
		$data = array(
			'domain' => $server,
			'order' => $tin_auth_config['order'],
			'sn' => $tin_auth_config['sn'],
			'v'	=>	$tinVersion['version']
		);
		if(tin_curl_post('http://www.zhiyanblog.com/cdn/tinection/ping_new.php',$data)){
			$return = tin_curl_post('http://www.zhiyanblog.com/cdn/tinection/ping_new.php',$data);
			$return2 = json_decode($return);
			$active = $return2->success;
			$key = $return2->key;
		}else{
			$active = 0;
		}
	}
	if($active!=1){
		$arr = array(
			'time' => time(),
			'active' => 0,
			'key' => ''
		);
		update_option('_wp_tin_authorize2',json_encode($arr));
		wp_die('主题未授权本域名，如果你购买了本主题，请先<a href="http://www.zhiyanblog.com/cdn/tinection/authorize.php" target="_blank" title="验证授权">验证授权</a>，并配置主题根目录tin-config.php中的相关授权参数。','域名未授权');
	}else{
		$arr = array(
			'time' => time(),
			'active' => 1,
			'key' => $key
		);
		update_option('_wp_tin_authorize2',json_encode($arr));
		eval(base64_decode(authcode($code,'DECODE',$key)));
	}
}
//add_action('init','tin_authorize');
tin_authorize();

?>